package org.example.model;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Id;import jakarta.persistence.Table;import java.time.LocalDateTime;@Table@Entity(name = "accountTransaction")public class AccountTransaction {    @Id    @Column(name = "transactionID", nullable = false, unique = true, length = 10)    private String tranactionID;    @Column(name = "userName")    private String userName;    @Column(name = "actions")    private String actions;    @Column(name = "type")    private String type;    @Column(name = "accountNumber")    private String accountNumber;    @Column(name = "transactionTime")    private LocalDateTime transactionTime;    public String getTranactionID() {        return tranactionID;    }    public void setTranactionID(String tranactionID) {        this.tranactionID = tranactionID;    }    public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getActions() {        return actions;    }    public void setActions(String actions) {        this.actions = actions;    }    public String getAccountNumber() {        return accountNumber;    }    public void setAccountNumber(String accountNumber) {        this.accountNumber = accountNumber;    }    public LocalDateTime getTransactionTime() {        return transactionTime;    }    public void setTransactionTime(LocalDateTime transactionTime) {        this.transactionTime = transactionTime;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }}